import s from './CompanyMarketingList.module.css';

const CompanyMarketingList = ({ newsList }) => {
	return (
		<>
			{newsList.map((news) => (
				<div className={`${s.news_list} section-container`}>
					<img src={news.img} alt="" />
					<div>
						<p>{news.title}</p>
						<p>{news.text}</p>
					</div>
				</div>
			))}
		</>
	);
};

export default CompanyMarketingList;
